import React from 'react'

class Form extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
          laaneBelop: null,
          nominellRente: null,
          terminGebyr: null,
          utlopsDato: null,
          saldoDato: null,
          datoForsteInnbetaling: null,
      }
    }
    myChangeHandler = (event) => {
        let nam = event.target.name;
        let val = event.target.value;
        this.setState({[nam]: val});
    }
    render() {
      return (
        <form>
        <h1>Hello {this.state.laaneBelop}</h1>
        <input
          type='number'
          name='laanebelop'
          onChange={this.myChangeHandler}
        />
        <input
          type='number'
          name='nominellRente'
          onChange={this.myChangeHandler}
        />
        <input
          type='number'
          name='terminGebyr'
          onChange={this.myChangeHandler}
        />
        <input
          type='date'
          name='utlopsDato'
          onChange={this.myChangeHandler}
        />
        <input
          type='date'
          name='saldoDato'
          onChange={this.myChangeHandler}
        />
        <input
          type='date'
          name='datoForsteInnbetaling'
          onChange={this.myChangeHandler}
        />
        </form>
      );
    }
  }

export default Form
